import { actionTypes } from "./action"

export const intialState={
    language:"eng"
}

export const lanReducer=(state=intialState, {type, payload})=>{
    console.log()
    switch(type){
        case actionTypes.CHANGELAN:{
            return{
                lan:payload
            }
        }
        default:{
            return state
        }
    }
}
